import { FC } from "react";

export const MainTableNavigation: FC = () => {
  return (
    <div className="desktop:flex hidden items-center border w-[40%]">
      <div className="pl-6">
        <span className="text-lg font-medium border border-gray-100 rounded-[2px] pr-4">
          Project Name
        </span>
      </div>
      <div>
        <span className="px-4 border border-gray-100 rounded-[2px]">
          Main Table
        </span>
      </div>
      <div>
        <span className="px-4 border border-gray-100 rounded-[2px]">
          Timeline
        </span>
      </div>
    </div>
  );
};
